// import NewRouteComponent from './NewRouteComponent';
import Option1 from './components/Option1';


function MyComponent() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/new-route');
  };

  return (
    <button onClick={handleClick}>Navigate to New Route</button>
  );
}
function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
        <Option1/>
