        <Route path="/College-Login" element={<CollegeLogin/>} />
        <Route path="/Student-Login" element={<StudentLogin/>} /> */}

        {/* ... other routes */}
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
